import { useEffect, useState } from "react";
import { Redirect } from "react-router-dom";
import axios from "axios";

function Dashboard({ setUser, user }) {
  const [isLoading, setIsLoading] = useState(true);
  const [error, setError] = useState(null);

  useEffect(() => {
    const token = localStorage.getItem("token");
    if (token) {
      axios
        .post("http://localhost:3002/users/verify", { token })
        .then(({ data }) => {
          setUser(data);
          setIsLoading(false);
        })
        .catch((error) => {
          setError(error);
          setIsLoading(false);
        });
    } else {
      setIsLoading(false);
    }
  }, [setUser]);

  if (!user.name) {
    return <Redirect to="/login" />;
  }

  if (isLoading) {
    return <div className="App">Loading...</div>;
  }

  if (error) {
    return <div className="App">{error.message}</div>;
  }

  if (!props.user.name) {
    return <Redirect to="/login" />;
  }

  return (
    <div className="content">
      <div className="container-fluid">
        <div className="row">
          <h3>
            Hello {user.name} {user.surname}
          </h3>
        </div>
        <div className="row">
          <div className="col-lg-3 col-sm-6">
            <div className="card card-stats">
              <div className="card-body">
                <div className="row">
                  <div className="col-5">
                    <div className="icon-big text-center icon-warning">
                      <i className="nc-icon nc-chart text-warning"></i>
                    </div>
                  </div>
                  <div className="col-7">
                    <div className="numbers">
                      <p className="card-category">Number</p>
                      <h4 className="card-title">150GB</h4>
                    </div>
                  </div>
                </div>
              </div>
              <div className="card-footer">
                <hr />
                <div className="stats">
                  <i className="fa fa-refresh"></i> Update Now
                </div>
              </div>
            </div>
          </div>
          <div className="col-lg-3 col-sm-6">
            <div className="card card-stats">
              <div className="card-body">
                <div className="row">
                  <div className="col-5">
                    <div className="icon-big text-center icon-warning">
                      <i className="nc-icon nc-light-3 text-success"></i>
                    </div>
                  </div>
                  <div className="col-7">
                    <div className="numbers">
                      <p className="card-category">Revenue</p>
                      <h4 className="card-title">$ 1,345</h4>
                    </div>
                  </div>
                </div>
              </div>
              <div className="card-footer">
                <hr />
                <div className="stats">
                  <i className="fa fa-calendar-o"></i> Last day
                </div>
              </div>
            </div>
          </div>
          <div className="col-lg-3 col-sm-6">
            <div className="card card-stats">
              <div className="card-body">
                <div className="row">
                  <div className="col-5">
                    <div className="icon-big text-center icon-warning">
                      <i className="nc-icon nc-vector text-danger"></i>
                    </div>
                  </div>
                  <div className="col-7">
                    <div className="numbers">
                      <p className="card-category">Errors</p>
                      <h4 className="card-title">23</h4>
                    </div>
                  </div>
                </div>
              </div>
              <div className="card-footer">
                <hr />
                <div className="stats">
                  <i className="fa fa-clock-o"></i> In the last hour
                </div>
              </div>
            </div>
          </div>
        </div>
      </div>
    </div>
  );
}
export default Dashboard;
